package com.mk.testservice;

import android.util.Log;

import ca.uhn.hl7v2.DefaultHapiContext;
import ca.uhn.hl7v2.HL7Exception;
import ca.uhn.hl7v2.HapiContext;
import ca.uhn.hl7v2.model.Message;
import ca.uhn.hl7v2.model.v24.datatype.ED;
import ca.uhn.hl7v2.model.v24.message.ORU_R01;
import ca.uhn.hl7v2.model.v24.segment.MSH;
import ca.uhn.hl7v2.model.v24.segment.OBR;
import ca.uhn.hl7v2.model.v24.segment.OBX;
import ca.uhn.hl7v2.model.v24.segment.PID;
import ca.uhn.hl7v2.parser.Parser;

public class MessageORUR01 {

    static String TAG = "MessageORUR01";

//    static   String imgBase64 = "data:image/jpeg;base64,";

    /**
     *
     * @param base64 base64 
     * @param deviceId ID
     * @param currentTime  
     * @param messageNo  1
     * @param patientNo 
     * @param patientName 
     * @param patientSex 
     * @param patientBird 
     * @param patientCheckTime 
     * @param reportNo 
     * @param operateName 
     * @param operateNo 
     * @return
     * @throws HL7Exception
     */
    public static String createOruR01(String base64, String deviceId, String currentTime, String messageNo,
                                      String patientNo, String patientName, String patientSex, String patientBird, String patientCheckTime,
                                      String reportNo, String operateName, String operateNo,
                                      String valueData, String valueUnit) throws HL7Exception {

        ORU_R01 oruR01 = new ORU_R01();
        setMsh(oruR01, messageNo, deviceId, currentTime);
        setResult(oruR01, base64, patientNo, patientName, patientSex,
                patientBird, patientCheckTime,reportNo,operateName,
                operateNo,valueData,valueUnit);

        HapiContext hapiContext = new DefaultHapiContext();
        Parser parser = hapiContext.getPipeParser();
        String encode = parser.encode(oruR01);

        Log.d(TAG, "ENCODE -> " + encode);
        return encode;

    }


    private static void setMsh(ORU_R01 oruR01, String messageNo, String deviceId, String currentTime) throws HL7Exception {
        //     
        MSH qryMsh = oruR01.getMSH();
        qryMsh.getFieldSeparator().setValue("|");
        qryMsh.getEncodingCharacters().setValue("^~\\&");
//        qryMsh.getSendingFacility().getNamespaceID().setValue(deviceId);
//        qryMsh.getDateTimeOfMessage().getTimeOfAnEvent().setValue(currentTime);
        qryMsh.getMessageType().getMsg1_MessageType().setValue("ORU");
        qryMsh.getMessageType().getMsg2_TriggerEvent().setValue("R01");
        qryMsh.getMessageControlID().setValue(messageNo);
        qryMsh.getProcessingID().getProcessingID().setValue("P");
        qryMsh.getVersionID().getVersionID().setValue("2.4");
        qryMsh.insertCharacterSet(0).setValue("ASCII");


    }

    //    
    //   
    //  ID 
    private static void setResult(ORU_R01 oruR01, String imgBase64, String patientNo,
                                  String patientName, String patientSex, String patientBird, String patientCheckTime,
                                  String reportNo, String operateName, String operateNo,
                                  String valueData, String valueUnit) throws HL7Exception {
        PID pid = oruR01.getPATIENT_RESULT().getPATIENT().getPID();

        pid.getSetIDPID().setValue(patientNo);
        pid.insertPatientName(0).getFamilyName().getSurname().setValue(patientName);
        pid.getPid7_DateTimeOfBirth().getTimeOfAnEvent().setValue(patientBird);
        pid.getPid8_AdministrativeSex().setValue(patientSex);


        OBR obr = oruR01.getPATIENT_RESULT().getORDER_OBSERVATION().getOBR();
        obr.getSetIDOBR().setValue(reportNo);
        obr.getUniversalServiceIdentifier().getIdentifier().setValue("");
        obr.getObr7_ObservationDateTime().getTimeOfAnEvent().setValue(patientCheckTime);
        obr.getCollectionVolume().getCq1_Quantity().setValue("1");

        OBX obx1 = oruR01.getPATIENT_RESULT().getORDER_OBSERVATION().getOBSERVATION(0).getOBX();
        OBX obx2 = oruR01.getPATIENT_RESULT().getORDER_OBSERVATION().getOBSERVATION(1).getOBX();
        setObx1(obx1,valueData,valueUnit,operateName,operateNo,patientCheckTime);
        setObx2(obx2,imgBase64);

    }

    private static void setObx2(OBX obx, String imgBase64) throws HL7Exception {
        obx.getObx1_SetIDOBX().setValue("2");
        Message message = obx.insertObx5_ObservationValue(0).getMessage();//  TYPE 
        ED ed = new ED(message);
        ed.getEd4_Encoding().setValue("Base64");
        ed.getData().setValue(imgBase64);
        obx.insertObx5_ObservationValue(0).setData(ed);
    }

    private static void setObx1(OBX obx, String valueData, String valueUnit, String operateName, String operateNo, String patientCheckTime ) throws HL7Exception {

        obx.getObx1_SetIDOBX().setValue("1");
        obx.getDateTimeOfTheObservation().getTimeOfAnEvent().setValue(patientCheckTime);
        obx.getObx16_ResponsibleObserver().getIDNumber().setValue(operateNo);
        obx.getObx16_ResponsibleObserver().getXcn2_FamilyName().getSurname().setValue(operateName);


        Message message = obx.insertObx5_ObservationValue(0).getMessage();
        ED ed = new ED(message);
        obx.getObx1_SetIDOBX().setValue("1");
        ed.getData().setValue(valueData);
        obx.insertObx5_ObservationValue(0).setData(ed);
        obx.getObx6_Units().getText().setValue(valueUnit);
    }

}
